    const selectedunitNo = this.unitDataForm.value.unitNo;
    console.log('selectedunitNo : ', selectedunitNo);

    const unitObject = { [selectedunitNo]: this.unitDataForm.value };

    console.log('unitObject', unitObject);

    this.ApiService.updateUnitToBuilding(unitObject, this.selectedBuildingId);
    // this.resetUnitForm();
  }


